#include <iostream>
#include <bitset>
#include <math.h>
#include <climits>
using namespace std;


#define MAXN 501
#define MAXNum 100100
int num[MAXN][MAXN];
int aggiunte[MAXN][MAXN];

bitset<MAXNum> primi ("");

void crivello()
{
    int fino = sqrt(MAXNum);
    primi[1] = true;
    primi[0] = true;
    for (int i = 4; i <= MAXNum; i+=2)
        primi[i] = true;
    
    int tmpDaAgg;
    for (int i = 3; i<= fino; i++)
        if (!primi[i])
        {
            tmpDaAgg = i<<1; // i*2
            for (int j = tmpDaAgg+i; j <= MAXNum; j+=tmpDaAgg)
                primi[j] = true;
        }
}

inline void scanInt(int& x)
{
    register char c = getchar_unlocked();
    x = 0;
    for(; (c<48)||(c>57);c = getchar_unlocked());
    for(; (c>47)&&(c<58);c = getchar_unlocked())
        x = (int)((((x)<<1) + ((x)<<3)) + c - 48);
}

int main(int argc, const char * argv[])
{
   // crivello();
    int r, c;
    scanInt(r); scanInt(c);
    
    for (int i = 0; i < r; i++)
        for (int j = 0; j < c; j++)
            scanInt(num[i][j]);
    
    for (int i = 0; i < r; i++)
        for (int j = 0; j < c; j++)
            while(primi[num[i][j]] == true) aggiunte[i][j]++, num[i][j]++;
 
    int min = INT_MAX;
    int sommatmp;
    //righe
    for (int i = 0; i < r; i++)
    {
        sommatmp= 0;
        for (int j = 0; j < c; j++)
            sommatmp+= aggiunte[i][j];
        if (sommatmp < min) min = sommatmp;
    }
    //colonne
    for (int i = 0; i < c; i++)
    {
        sommatmp= 0;
        for (int j = 0; j < r; j++)
            sommatmp+= aggiunte[j][i];
        if (sommatmp < min) min = sommatmp;
    }
    
    cout<<min;

  
    return 0;
}

